import React, { Component } from 'react';
import BillingAmount from '../../molecules/main/BillingAmount';
import ProceedPayment from '../../molecules/payment/ProceedPayment';

class BillingSection extends Component {
    render() {
        return (
            <section className='billingSection'>
                <BillingAmount {...this.props}/>
                <ProceedPayment {...this.props} />
            </section>
        )
    }
}

export default BillingSection
